import React from 'react';
import img from '../child2-01.png';
import '../style.css';
const Accueil = ()=>
{
    return (
        <div className='container'style={{height:"100vh"}}>
            <div className='card shadow parent'>
                <div className='card col-6 bg-description description p-3'>
                commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. <br/>
                Lorem ipsum may be used as a placeholder before the final copy is available. It is also used to temporarily replace text in a process called greeking, <br/>
                which allows designers to consider the form of a webpage or publication, without the meaning of the text influencing the design
                </div>
                <div>
                    <button></button>
                </div>
                <img style={{width:"100%"}} src={img} alt='home'></img>
            </div>
            
        </div>
    )
}

export default Accueil
